import React from 'react'
import './style'

const App: React.FC = () => {
	const buttons = [
		{ type: '', text: 'plain' },
		{ type: 'primary', text: 'primary' },
		{ type: 'success', text: 'success' },
		{ type: 'info', text: 'info' },
		{ type: 'warning', text: 'warning' },
		{ type: 'danger', text: 'danger' }
	] as const
	return (
		<div>
			<div className='mb-10'>
				{buttons.map((button) => {
					return (
						<Button key={button.text} type={button.type} text>
							{button.text}
						</Button>
					)
				})}
			</div>
			<div className='mb-10'>
				{buttons.map((button) => {
					return (
						<Button key={button.text} type={button.type} text bg>
							{button.text}
						</Button>
					)
				})}
			</div>
			<div className='mb-10'>
				{buttons.map((button) => {
					return (
						<Button key={button.text} type={button.type} text disabled>
							{button.text}
						</Button>
					)
				})}
			</div>
		</div>
	)
}

